import React from 'react';
import '../css/Menu.css';

function Menu() {
    return (
        <div className="container">
            <h1 className="title">Menu</h1>
            <div className="menu">
                <div className="left">
                    <a href="/usuarios" className="button">Usuarios</a>
                    <a href="/pagina" className="button">Pagina</a>
                </div>
                <div className="right">
                    <a href="/noticias" className="button">Noticias</a>
                    <a href="/eventos" className="button">Eventos</a>
                </div>
                <div className="bottom">
                    <a href="/encunestas" className="button">Encunestas</a>
                </div>
            </div>
        </div>
    );
}

export default Menu;
